import React from "react";
import Card from "react-bootstrap/Card";
import "./index.css";

const Profile = () => {
  return (
    <div className="mx-auto my-5 center">
      <h2 className="my-2">Profile</h2>
      <Card className="p-3"></Card>
    </div>
  );
};

export default Profile;
